window.bookSummaryJSON = "<p>Never volunteer for active duty... </p> <p>Bob Howard is a low-level techie working for a super-secret government agency. While his colleagues are out saving the world, Bob's under a desk restoring lost data. His world was dull and safe; but then he went and got Noticed. Now, Bob is up to his neck in spycraft, alternative universes, dimension-hopping terrorists, monstrous elder gods and the end of the world. Only one thing is certain: it will take more than ‘control+alt+delete’ to sort this mess out... </p> <p>This is the first novel in <i>The Laundry Files</i>. This audiobook includes the short story <i>The Concrete Jungle</i>. </p>"; 
